import { makeStyles } from "@mui/styles";

const ChatStyle = makeStyles({
    Container: {
        height: "100vh",
        width: "100vw",
        display: "grid",
        gridTemplateColumns: "25% 75%",
        backgroundColor: "white",
    }
});

export default ChatStyle
